import React from 'react';

function PricingPage() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>صفحة التسعير والاشتراكات</h1>
      <p>هنا سيتم عرض خطط الاشتراك المتاحة للمنصة القانونية.</p>
    </div>
  );
}

export default PricingPage;
